import React from 'react';
import moment from 'moment';
import './App.css';


class App extends React.Component {

  constructor(props) {
    super(props);
    this.state = { 
      userAvailableDishes: 3
    };
  }

  componentDidMount() {
    fetch('https://testapi.io/api/sajhu/dishes')
        .then( res => res.json())
        .then((data)=> {
            this.setState({
                dishes: data
            });
        })
  }  


  render() {
    return <h1>Hello, {this.props.name}</h1>;
  }
}

export default App;
